import React from 'react'
import './SideBar.css';
import { Nav, Navbar, NavbarBrand, NavbarToggler, NavLink, NavItem, DropdownToggle, DropdownMenu, DropdownItem, NavbarText, Collapse, UncontrolledDropdown, Row, Col } from 'reactstrap';
// import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';

export default function SideBar() {
    return (
        <div>
            <div className="wrapper">
                <div className="sidebar">
                    <div className="profile">
                        <img src ="https://1.bp.blogspot.com/-vhmWFWO2r8U/YLjr2A57toI/AAAAAAAACO4/0GBonlEZPmAiQW4uvkCTm5LvlJVd_-l_wCNcBGAsYHQ/s16000/team-1-2.jpg"/>
                        <h3>Anamika Roy</h3>
                        <p>Designer</p>
                    </div>
                </div>
            </div>
        </div>
    )
}
